import React from 'react';
import {SideImageContainer} from './ProfileCardElements';

import Image from 'react-bootstrap/Image'
import valorant from '../../images/user1.png'


const sideImage = () => {
    return (
        <div>
            <SideImageContainer>
                <Image class="w-50 p-3" src={valorant} roundedCircle /> 
            </SideImageContainer>
        </div>
    )
}

export default sideImage
